// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awStaticListCommandRenderFunction } from 'js/AwStaticListCommandService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwStaticListCommandService', () => import('js/AwStaticListCommandService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awStaticListCommandRenderFunction",
            "deps": "js/AwStaticListCommandService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "props": {
        "item": {
            "type": "object"
        },
        "index": {
            "type": "object"
        },
        "item-options": {
            "type": "object"
        },
        "dataprovider": {
            "type": "object"
        },
        "fixed-cell-height": {
            "type": "string"
        },
        "is-group-list": {
            "type": "string"
        }
    },
    "ctx": {
        "clauseName": null
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "AwStaticListCommand",
    "_uniqueViewModelId": "AwStaticListCommand"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awStaticListCommandRenderFunction, undefined, ctxImportObj );

export default Component;
